import styles from "./Options.module.css";
import NavBar from "../../componets/layout/Navbar";
import Footer from "../../componets/layout/Footer";
import React, { useState, useEffect } from "react";
import api from "../../client/api";

function Options() {
  const [professores, setProfesores] = useState([]);
  const [projetos, setProjetos] = useState([]);
  const [turmas, setTurmas] = useState([]);
  const [chamadaAtiva, setChamadaAtiva] = useState(false);
  const [projetoSelecionado, setProjetoSelecionado] = useState("");
  const [professorSelecionado, setProfessorSelecionado] = useState("");
  const [turmaSelecionada, setTurmaSelecionada] = useState("");

  const handleProjetoChange = (event) => {
    setProjetoSelecionado(event.target.value);
  };

  const handleProfessorChange = (event) => {
    setProfessorSelecionado(event.target.value);
  };

  const handleTurmaChange = (event) => {
    setTurmaSelecionada(event.target.value);
  };

  const handleClick = () => {
    setChamadaAtiva(!chamadaAtiva);
  };

  const handleCadastrarChamada = () => {
    // Verifica se os valores dos dropdowns foram selecionados
    if (projetoSelecionado && professorSelecionado && turmaSelecionada) {
      // Atualiza a tabela com os valores selecionados dos dropdowns
      const tabela = document.getElementById("example");
      const tbody = tabela.querySelector("#tbody");
      const tr = document.createElement("tr");
      const tdProjeto = document.createElement("td");
      const tdProfessor = document.createElement("td");
      const tdTurma = document.createElement("td");

      tdProjeto.textContent = projetoSelecionado;
      tdProfessor.textContent = professorSelecionado;
      tdTurma.textContent = turmaSelecionada;

      tr.appendChild(tdProjeto);
      tr.appendChild(tdProfessor);
      tr.appendChild(tdTurma);

      tbody.appendChild(tr);
    }
  };

  useEffect(() => {
    const fetchProfesores = async () => {
      try {
        const response = await api.professor.listAll();
        console.log(response.data);
        setProfesores(response.data);
      } catch (error) {
        console.error("Erro ao buscar os profesores", error);
      }
    };

    fetchProfesores();
  }, []);

  useEffect(() => {
    const fetchProjetos = async () => {
      try {
        const response = await api.projeto.listAll();
        console.log(response.data);
        setProjetos(response.data);
      } catch (error) {
        console.error("Erro ao buscar os projetos", error);
      }
    };

    fetchProjetos();
  }, []);

  useEffect(() => {
    const fetchTurmas = async () => {
      try {
        const response = await api.turma.listAll();
        console.log(response.data);
        setTurmas(response.data);
      } catch (error) {
        console.error("Erro ao buscar os projetos", error);
      }
    };

    fetchTurmas();
  }, []);

  return (
    <div>
      <NavBar />
      <body onload="tabela(lista)">
        <section class={styles.page_content}>
          <section class={styles.search_and_user}>
            <div class={styles.admin_profile}>
              <span class={styles.greeting}>Hello admin</span>
              <i class="fa-solid fa-circle-user"></i>
            </div>
          </section>
          <section className={styles.grid}>
            <div className={styles.center}>
              <div className={styles.dropdownContainer}>
                <label htmlFor="projeto">Projetos:</label>
                <select
                  id="projeto"
                  value={projetoSelecionado}
                  onChange={handleProjetoChange}
                >
                  <option value="">Selecione um projeto</option>
                  {projetos.map((projeto) => (
                    <option key={projeto.id} value={projeto.id}>
                      {projeto.Nome}
                    </option>
                  ))}
                </select>
              </div>
              <div className={styles.dropdownContainer}>
                <label htmlFor="professor">Professores:</label>
                <select
                  id="professor"
                  value={professorSelecionado}
                  onChange={handleProfessorChange}
                >
                  <option value="">Selecione um professor</option>
                  {professores.map((professor) => (
                    <option key={professor.id} value={professor.id}>
                      {professor.Nome}
                    </option>
                  ))}
                </select>
              </div>
              <div className={styles.dropdownContainer}>
                <label htmlFor="turma">Turma:</label>
                <select
                  id="turma"
                  value={turmaSelecionada}
                  onChange={handleTurmaChange}
                >
                  <option value="">Selecione uma turma</option>
                  {turmas.map((turma) => (
                    <option key={turma.id} value={turma.id}>
                      {turma.Nome}
                    </option>
                  ))}
                </select>
              </div>
            </div>
            <button
              className={styles.botao}
              onClick={handleClick}
            >
              Cadastrar Chamada
            </button>
          </section>
          <section class={styles.grid}>
            <table id="example">
              <thead>
                <tr>
                  <th>Projeto</th>
                  <th>Professor</th>
                  <th>Turma</th>
                </tr>
              </thead>
              <tbody id="tbody">
                <tr>
                  <td>{professorSelecionado}</td>
                </tr>
              </tbody>
            </table>
          </section>
          <script
            src="https://kit.fontawesome.com/a146d88807.js"
            crossorigin="anonymous"
          ></script>
          <script src="//code.jquery.com/jquery-3.3.1.js"></script>
          <script src="//cdn.datatables.net/1.10.20/js/jquery.dataTables.min.js"></script>
          <script src="{{ url_for('static', filename='js/home-table.js') }}"></script>
          <script src="{{ url_for('static', filename='js/toggle-menu.js') }}"></script>
        </section>

      </body>
      <Footer />
    </div >

  );
}

export default Options;
